import React from 'react';

function ExpenseItem() {
  return (
    <div>
      <div>Expense Items</div>
      <div>
        <div>Food Rs 10</div>
        <div>Petrol Rs 100</div>
        <div>Movies Rs 200</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
